import './App.css';
import {useState} from "react"

function App() {

  const [user_handle, setUser_Handler] = useState("");
  const [first_name, setFirst_Name] = useState("");
  const [last_name, setLast_Name] = useState("");
  const [phonenumber, setPhonenumber] = useState("");

  const mostrarDatos = ()=>{
    alert(user_handle);
  }

  return (
    <div className="App">
      <div className="Datos">
          <label>user_handle<input 
          onChange={(event)=>{
            setUser_Handler(event.target.value);
          }}
          type="text"
          ></input></label>
          <label>first_name <input 
          onChange={(event)=>{
            setFirst_Name(event.target.value);
          }}
          type="text"></input></label>
          <label>last_name <input 
          onChange={(event)=>{
            setLast_Name(event.target.value);
          }}
          type="text"></input></label>
          <label>phonenumber <input 
          onChange={(event)=>{
            setPhonenumber(event.target.value);
          }}
          type="text"></input></label>
          <button onClick={mostrarDatos}>Registrar</button>
      </div>
    </div>
  );
}

export default App;
